import React from "react";
const axios = require('axios');

axios.post();

const StyleForList: any = {
    margin: '0 auto'
}



const unOrList: any = () =>{
    return (
        <ul style={StyleForList}>
            <li>1</li>
            <li>2</li>
            <li>3</li>
            <li>4</li>
        </ul>
    );
}

export default unOrList;
